description:
Captured with S-Video to DVD Recorder

English subtitles are available, I&amp;#039;ll probably upload them to opensubtitles.org
or somewhere.

&quot;Tobey or Consequences&quot;
While Tobey has a babysitter, WG and Tobey get into a battle of words on a real-live match of the game show &quot;Crash or Pie.&quot;
Vocab words: Enormous, Bicker

&quot;High-Fat Robbery&quot;
The Butcher is hosting free barbecues as diversions to help him carry out his crimes; WordGirl takes him down, after discovering his meaty powers are neutralized by tofu!
Vocab words: Impressive, Diversion
